import React, { useEffect, useState } from 'react';
import apiGetJobs from '../api_call/getJobs';
import jobsList from '../api_call/manualLibrary';

function Jobs() {
  const [jobs, setJobs] = useState([]);
  useEffect(() => {
    const getJobs = async () => {
      setJobs(await apiGetJobs());
    }
    getJobs();
  // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);
  console.log(jobs);

  return(
    <div>
      Hello World!
      {
        jobs ? 
          jobs.map((job) => (
            <p>{job.jobTitle}</p>
          ))
         : 
            jobsList.map((job) => (
              <p>{job.jobTitle}</p>
            ))
      }
    </div>
  );
}

export default Jobs;
